// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

contract Dwetransfer {
  address public owner;
  uint256 private counter;

  constructor(){
    counter = 0;
    owner = msg.sender;
  }

  struct file {
    uint256 id;
    address tweeter;
    string fileUrl;
  }

  event tweetPublished (
    uint256 id,
    address tweeter,
    string fileUrl
  );

  event FileGetCid(uint256 id, string fileUrl);

  mapping(uint256 => file) files;


  function getFile(uint256 id) public payable returns(uint256 , string memory, address){
    require(id < counter, "No tweet id");
    require(msg.value == (0.2 ether), "Please submit 0.2 ether");
    file storage item = files[id];
    payable(owner).transfer(0.1 ether);
    payable(item.tweeter).transfer(0.1 ether);
    emit FileGetCid(id, item.fileUrl);
    return(item.id, item.fileUrl, item.tweeter);
  }

  function addTweet(string memory fileUrl)public payable returns (uint256){
    require(msg.value == (0.1 ether), "Please submit 0.1 ether");
    file storage newFile = files[counter];

    newFile.tweeter = msg.sender;
    newFile.id = counter;
    newFile.fileUrl = fileUrl;

    emit tweetPublished(counter, msg.sender, fileUrl);
    counter++;
    payable(owner).transfer(msg.value);
    return(newFile.id);
  }


}
